import React, { useEffect } from 'react'
import { Link } from 'react-router-dom'
import Lobby from '../Screens/Lobby'

const MeetPage = ({ setIsMeet }) => {
    useEffect(() => {
        setIsMeet(true)
    }, [])
    return (
        <div>
            <Lobby />
            <Link to={'/'}>
                <button onClick={() => setIsMeet(false)}>Leave</button>
            </Link>
        </div>
    )
}

export default MeetPage
